INSERT INTO AppointmentEntity (
    id,
    start_date_time,
    duration_in_seconds,
    appointment_status,
    location,
    previous_appointment_id,
    patient_full_name,
    patient_email,
    patient_phone_number,
    patient_reason,
    clinician_notes,
    is_acknowledged,
    created_at,
    updated_at
) VALUES
(1, '2025-11-18 09:00:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Barnaby Broccoli', 'barnaby@floret.com', '5550000001', 'My florets are drooping and I''m experiencing an existential crisis about being a ''superfood.'' The pressure is immense. Also, I think I heard a caterpillar whisper my name, and I am convinced my stalk is being stalked. I need to talk about this paranoia before I''m blanched.', 'Patient presents as a tightly-wound floret cluster. Expresses conspiratorial beliefs about caterpillars and the ''Great Blender.'' Suspects the fridge light is a surveillance device. Recommended patient avoid the cheese aisle, as it increases feelings of being ''sauced.'' Prescribed 10cc of sunlight.', false, '2025-11-17 09:00:00', '2025-11-17 09:00:00'),
(2, '2025-11-18 09:30:00', 1800, 'SCHEDULED', 'Pod 2 (Telehealth)', NULL, 'Penelope Pea', 'penelope@pod.net', '5550000002', 'I feel trapped in this pod! It''s claustrophobic, and I''m surrounded by my identical siblings 24/7. We all look the same, and I''m losing my sense of self. What if I''m not the *real* Penelope? What if I''m just ''Pea #4''? I''m having a profound identity crisis and I just want to roll away.', 'Patient is one of eight identical peas. Displayed significant ''pod anxiety'' and a desire for individual recognition. We discussed the philosophy of ''pea-ness'' and the existential dread of the casserole. Patient rolled off the table twice, claiming ''it was an accident.'' Recommended solo time in a small bowl.', false, '2025-11-17 09:05:00', '2025-11-17 09:05:00'),
(3, '2025-11-18 10:00:00', 1800, 'COMPLETED', 'The Root Cellar', NULL, 'Carl Carrot', 'carl.carrot@taproot.org', '5550000003', 'I am terrified of the dark. I''ve spent my whole life underground, and now that I''m out, I can''t stand it when the lights go off. I''m also convinced I''m being followed by rabbits, and I''m worried my vibrant orange color is ''too loud.'' My leafy-green hair is also thinning, which is causing me great distress.', 'Patient is high-strung, very rigid. Obsessed with his orange-ness, simultaneously proud and fearful. Claims rabbits are a ''government conspiracy'' to ''manage the root vegetable population.'' He jumped when I pulled out my pen, mistaking it for a peeler. Prescribed a nightlight and a hat. Referred to a dermatologist for the foliar concerns.', true, '2025-11-17 09:10:00', '2025-11-17 09:10:00'),
(4, '2025-11-18 10:30:00', 1800, 'REQUESTED', 'Telehealth', NULL, 'Archibald Artichoke', 'archie@guarded.com', '5550000004', 'I have a hard time letting people in. I''ve built up all these... layers. These emotional walls. I''m tough on the outside, but I know, deep down, there''s a tender heart. But I just don''t know how to show it. I''m afraid if I open up, people will just want to dip me in butter and devour me.', 'Patient is emotionally guarded, literally. We spent the first 30 minutes just trying to get past his outer bracts. He speaks in metaphors and sighs heavily. Expressed a deep-seated ''fear of melting.'' Patient has a severe trust issue, specifically with melted butter and garlic. Recommended group therapy with other ''guarded'' foods.', false, '2025-11-17 09:15:00', '2025-11-17 09:15:00'),
(5, '2025-11-18 11:00:00', 1800, 'SCHEDULED', 'Room 5', NULL, 'Lucinda Leek', 'lucy@allium.net', '5550000005', 'I feel like I''m being pulled in a million different directions. I''m not a scallion, I''m not an onion, I''m... me! But nobody appreciates my subtle flavor. They just chop me up and throw me in a soup. I have layers, too, you know! But my layers are sophisticated, not like those vulgar onions!', 'Patient has a superiority complex mixed with profound insecurity. Insists on being called ''the sophisticated allium.'' Complained that the office lighting was ''too harsh'' for her delicate green tops. We explored her feelings of being ''the supporting cast'' in the culinary world. Patient became irate when I mentioned ''potato-leek soup.'' Avoid this topic on follow-up.', false, '2025-11-17 09:20:00', '2025-11-17 09:20:00'),
(6, '2025-11-18 11:30:00', 1800, 'CANCELED', 'The Compost Heap', NULL, 'Beatrice ''Beet'' Root', 'b.root@stains.com', '5550000006', 'I''m just... I''m bleeding! I''m bleeding all over the place! Every time I''m cut, it''s a mess. It''s traumatizing. I can''t go near a kitchen knife without having a panic attack. I''m also really worried about my complexion. Is this shade of purple ''too much''? I feel like I stain everything I touch, metaphorically.', 'Patient presented with a very... colorful... disposition. Expressed significant trauma related to ''bleeding'' and ''staining.'' We discussed that this is a natural part of her ''beet-ness,'' but she remains unconvinced. She is worried she is ''emotionally staining'' her friends and family. Recommended she avoid white upholstery. Patient CANCELED, citing a ''scheduling conflict with a salad.''', true, '2025-11-17 09:25:00', '2025-11-17 09:25:00'),
(7, '2025-11-18 12:00:00', 1800, 'SCHEDULED', 'The Dark Corner (Room 1)', NULL, 'Miles Mushroom', 'miles@spore.net', '5550000007', 'I''ve seen things, man. Things in the dark. I''ve been in the dark my whole life, just... feeding on... well, you know. It''s given me a complex. I''m a fungi, but am I a *fun guy*? I''m worried I''m toxic. I have this recurring dream where I''m on a pizza and a giant is eating me. It''s too much.', 'Patient (self-identifies as ''Mad Eye Moody Mushroom'') is clearly suffering from spore-induced paranoia. Believes he is a ''gateway'' to other dimensions and that the ''Great Spore-bearer'' is speaking through him. His gills were visibly trembling. Cautioned patient against fraternizing with the Shiitakes, as they are a ''bad influence.'' Prescribed a sunlamp and a new pot of soil.', false, '2025-11-17 09:30:00', '2025-11-17 09:30:00'),
(8, '2025-11-18 12:30:00', 1800, 'COMPLETED', 'The Kernel (Telehealth)', NULL, 'Cornelius ''Corny'' Corn', 'c.c@husk.org', '5550000008', 'I''m stuck in a husk. A prison of my own making. I''m also suffering from ''pop'' anxiety. What if I just... explode? What if the pressure gets too high? And my teeth! They''re all yellow. I''m so self-conscious. I also keep telling these awful jokes, these ''corny'' jokes. I can''t stop myself. It''s a compulsion.', 'Patient has a kernel of truth in his anxieties, but has magnified them. He is obsessed with ''popping'' and fears high temperatures. We discussed his ''corny'' joke-telling as a defense mechanism to hide his fear of becoming ''popcorn,'' a state he describes as ''losing all individuality.'' Recommended he stay off the cob and avoid open flames. His silk is a mess.', true, '2025-11-17 09:35:00', '2025-11-17 09:35:00'),
(9, '2025-11-18 13:00:00', 1800, 'NO_SHOW', 'The Patch (Room 4)', NULL, 'Patty Pumpkin', 'patty@gourd.com', '5550000009', 'It''s not even October, and people are already talking about ''carving'' me! It''s barbaric! I''m supposed to be a symbol of the harvest, of abundance, and all anyone wants to do is scoop out my insides and put a candle in my head. I have nightmares about it. I just want to be a pie. A nice, respectable pie.', 'Patient was a NO_SHOW. I suspect the seasonal anxiety was too high. The patient is extremely large and difficult to transport. We may need to make a home visit, but I am concerned about being ''scooped'' myself. Will follow up via email after the carving season has passed. This is the third NO_SHOW this season.', false, '2025-11-17 09:40:00', '2025-11-17 09:40:00'),
(10, '2025-11-18 13:30:00', 1800, 'REQUESTED', 'The Vine (Telehealth)', NULL, 'Tommy Tomato', 't.tomato@nightshade.com', '5550000010', 'I can''t decide if I''m a fruit or a vegetable. The existential dread is crushing. The Supreme Court weighed in, but it didnt solve my personal identity crisis. I get put in salads, which is vegetable territory, but I have seeds! This ambiguity is causing me to ripen unevenly and I''m developing soft spots.', 'Patient is experiencing a severe fruit/vegetable identity crisis. He becomes very agitated when the word ''ketchup'' is mentioned, calling it ''the pulp-ification of my people.'' We discussed that identity is a social construct, but this seemed to make him angrier. He insists on being classified as a ''savory berry.'' This is... complex.', false, '2025-11-17 09:45:00', '2025-11-17 09:45:00'),
(11, '2025-11-19 09:00:00', 1800, 'SCHEDULED', 'Room 1 (Cooler)', NULL, 'Celinda Celery', 'c.celery@stalk.com', '5550000011', 'I feel so... hollow inside. Stringy, even. People only want me for my crunch, but nobody appreciates my subtle, watery essence. I''m tired of being dipped in ranch dressing and peanut butter. I have more to offer! I''m also terrified of juicers. The sound they make... it''s the sound of nightmares.', 'Patient presents as extremely rigid and fibrous. Expressed feelings of "emptiness" and being "used as a vessel" for various dips. We explored her "string theory," a belief that her strings are cosmic tethers. She appears to have a severe phobia of blenders and juicers (Vitamixophobia). Recommended avoiding the dip aisle and perhaps taking up a hobby that doesn''t involve crudité platters.', false, '2025-11-17 10:00:00', '2025-11-17 10:00:00'),
(12, '2025-11-19 09:30:00', 1800, 'REQUESTED', 'The Patch (Room 4)', NULL, 'Zane Zucchini', 'zane@gourd.org', '5550000012', 'I am in a deep seasonal depression. Every summer, I''m the star. Everyone wants me. Then August ends, and *poof*! Nobody cares. They leave me on their neighbor''s porch like some unwanted burden. I''m worried I''m just a "gateway" vegetable for the "real" squashes. My self-worth plummets with the temperature.', 'Patient shows classic signs of Seasonal Popularity Disorder (SPD). His sense of self is tied to summer barbecues. He expressed bitterness towards the "autumnal gourds" (specifically pumpkins). We discussed his fear of "zoodles," which he sees as a "perversion of his true form." Patient needs to find value outside of his peak growing season. Suggested he explore his potential as "bread."', false, '2025-11-17 10:05:00', '2025-11-17 10:05:00'),
(13, '2025-11-19 10:00:00', 1800, 'COMPLETED', 'Pod 2 (Telehealth)', NULL, 'Edward Edamame', 'ed@pod.net', '5550000013', 'I need anger management. I get so... steamed. I''m boiled alive, and then people just *squeeze* me out of my home, right onto the table! It''s barbaric. I have no personal space. And the salt! It''s adding insult to injury. I''m worried one day I''m going to pop and hit someone in the eye. I feel so much pressure.', 'Patient was visibly agitated and "steamed" during the session. Complained about being "manhandled" and "popped" in public. He has a recurring nightmare of being the "last bean in the pod." We practiced relaxation techniques, but he just got hotter. His anger seems to be a defense mechanism against his fear of being an appetizer.', true, '2025-11-17 10:10:00', '2025-11-17 10:10:00'),
(14, '2025-11-19 10:30:00', 1800, 'SCHEDULED', 'Room 5', NULL, 'Rhonda Rhubarb', 'rhonda@stalk.com', '5550000014', 'I am TOXIC. Well, parts of me are. My leaves... they could kill. How do you live with yourself knowing you''re part-poison? I''m terrified I''ll accidentally hurt someone. I''m also constantly mistaken for a fruit just because I end up in a pie. I''m a VEGETABLE, damn it! I''m complex and a little dangerous!', 'Patient has a "toxic leaf" complex and a pronounced identity crisis. She is obsessed with her poisonous qualities, which she brings up in every topic. "Oh, a nice day? You know what''s not nice? MY LEAVES." We are working on separating her identity from her toxic components. Also, she has severe animosity towards strawberries, who she feels "drag her into the fruit category."', false, '2025-11-17 10:15:00', '2025-11-17 10:15:00'),
(15, '2025-11-19 11:00:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Kale ''Kenny'' K.', 'kenny@cruciferous.com', '5550000015', 'I''m so tough, and I hate it. People say I''m "fibrous" and "hard to chew." They have to massage me with oil just to make me palatable. It''s humiliating! I just want to be soft and loved, like a piece of iceberg lettuce. But no, I''m "healthy" and "robust." I''m sick of being a status symbol for smoothies.', 'Patient is suffering from "toughness dysphoria." He longs to be a "limp, meaningless lettuce" but is cursed with "superior nutritional content." He expressed deep resentment towards his own "curly" nature. We explored the trauma of being "massaged" and "de-ribbed" by humans. Patient seems to believe he is the "cross-fit bro" of the vegetable world and is tired of the pressure.', false, '2025-11-17 10:20:00', '2025-11-17 10:20:00'),
(16, '2025-11-19 11:30:00', 1800, 'REQUESTED', 'The Root Cellar', NULL, 'Dr. Percy Parsnip', 'percy@root.org', '5550000016', 'I am living in the shadow of the carrot. We look so similar, but I am *not* a "white carrot." I am a parsnip! I have my own nutty, sweet flavor! Why does everyone try to "fix" me? They glaze me, roast me, mash me... just let me be pale and interesting! My entire existence feels like a case of mistaken identity.', 'Patient is highly fixated on his "carrot" complex. He became irate when I asked if he''d ever met Carl Carrot, accusing me of "trying to set up a confrontation." He is pale, but also deeply bitter. We discussed that his "sweet, nutty flavor" is valid, even if the public is "uneducated." Patient needs to build self-esteem based on his own "parsnip-ness" and not in opposition to carrots.', false, '2025-11-17 10:25:00', '2025-11-17 10:25:00'),
(17, '2025-11-19 12:00:00', 1800, 'CANCELED', 'Room 1 (Cooler)', NULL, 'Olga Onion', 'olga@allium.net', '5550000017', 'I make everyone cry. I can''t get close to *anyone* without them weeping. As soon as I open up, as soon as they get through my layers, the waterworks start. Do you know what that does to your self-esteem? I just want to be held, but my pungent, sulfuric aura is too much. I am destined to be alone, probably in a soup.', 'Patient CANCELED. Sent a text saying: "I made the receptionist cry. I can''t do this. I''m just going to stay in my mesh bag." This confirms the patient''s primary complaint. We are exploring tele-health options, but I am worried the video call will "sting the eyes." This is a deeply layered individual whose "pungency" is a core defense mechanism.', true, '2025-11-17 10:30:00', '2025-11-17 10:30:00'),
(18, '2025-11-19 12:30:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Professor Pepper (Bell)', 'bell@capsicum.com', '5550000018', 'I''m hollow. Utterly hollow inside. I look bright and cheerful—red, yellow, orange—but I''m just a facade. A colorful, crunchy shell. And people just *stuff* me. They fill my emptiness with rice, with meat, with cheese... they don''t care about *me*. They just want a vessel. And I have so many seeds! It''s a mess.', 'Patient presents as cheerful, but is emotionally vacant. He described his "hollowness" as a "void" that "echoes" when he''s jostled. He has a "seed-hoarding" complex, believing his seeds are his "only true children." We discussed that his "hollowness" is what makes him "versatile," but he interpreted this as being "codependent." Needs to work on finding internal validation, not "fillings."', false, '2025-11-17 10:35:00', '2025-11-17 10:35:00'),
(19, '2025-11-19 13:00:00', 1800, 'REQUESTED', 'Telehealth', NULL, 'Count Garlic', 'garlic@clove.net', '5550000019', 'I am afraid... of *vampires*. I know, it''s ironic! But the pressure is immense. I am expected to ward them off, but what if I''m not strong enough? What if my "pungency" is just... a myth? I have this recurring nightmare where a vampire just... eats me. On toast! I also suffer from "clove-strophobia." I hate being pressed.', 'Patient, who insists on being called "Count," speaks with a dramatic flair. He is wrapped in a papery, dry shawl. He has a messianic complex, believing he is the "savior" of the culinary world, but is terrified of failing. His fear of "pressing" seems to be a major source of anxiety. He refuses to be in the same room as Olga Onion, calling her "an amateur."', false, '2025-11-17 10:40:00', '2025-11-17 10:40:00'),
(20, '2025-11-19 13:30:00', 1800, 'COMPLETED', 'The Root Cellar', NULL, 'Titus Turnip', 'titus@root.org', '5550000020', 'Nobody respects me. I''m the "forgotten" root. I''m not as sweet as a carrot, not as earthy as a beet, not as "in" as a parsnip. I''m just... a turnip. I''m bitter, and I know it. I''m bitter because I''m overlooked! I''m stuck in the past. I feel like I peaked in the 18th century. How do I become relevant again?', 'Patient has a "bitter" disposition, which he projects onto everyone. He is suffering from "relevance anxiety" and "potato-envy." He complained that "even the radishes" have a "better marketing team." We discussed his "purple top" as a "crown," but he just saw it as a "gaudy hat." Patient is deeply cynical. He was "mashed" as a child and has never recovered. Recommended he try "not" being in a stew.', true, '2025-11-17 10:45:00', '2025-11-17 10:45:00'),
(21, '2025-11-20 09:00:00', 1800, 'SCHEDULED', 'The Patch (Room 4)', NULL, 'Spud "Tater" Smith', 'spud@tuber.com', '5550000021', 'I have too many eyes, but I cannot see. It''s a paradox that haunts my starchy soul. I''m also terrified of being "mashed." It sounds so... final. I''m not just a side dish; I am a main event! I also have a complex about my "eyes." Are they watching me? Am I watching *them*? It''s deeply unsettling.', 'Patient (a large Russet) presents with "Ocular Paradox Anxiety." He is covered in "eyes" but expresses profound "sightlessness." He is obsessed with his "potential," which he describes as "either a fry or a bake." We discussed his fear of "the peeler" as a "symbol of identity removal." Patient is very starchy and resistant to change. Recommended he stay in a cool, dark place and avoid sharp objects.', false, '2025-11-17 11:00:00', '2025-11-17 11:00:00'),
(22, '2025-11-20 09:30:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Calvin Cauliflower', 'cal@floret.com', '5550000022', 'I''m just a "pale broccoli." I know that''s what everyone thinks. I''m the "ghost" of the cruciferous family. I try to be interesting—I can be orange! I can be purple!—but everyone just wants to cover me in cheese sauce. I feel like my "brainy" appearance is a lie. I''m not smart; I''m just dense.', 'Patient has severe "albino broccoli syndrome." He is deeply insecure about his pale-white complexion and is envious of Barnaby Broccoli''s "vibrant green." We discussed his "brain-like" texture, which he feels is "deceptive" and "sets expectations too high." He has a "cheese-codependency" issue. Suggested he try "ricing" as a form of reinvention, but he found the idea "disrespectful." Needs validation.', false, '2025-11-17 11:05:00', '2025-11-17 11:05:00'),
(23, '2025-11-20 10:00:00', 1800, 'COMPLETED', 'Room 1 (Cooler)', NULL, 'Ricky Radish', 'ricky@root.org', '5550000023', 'I''m too spicy! I''m too peppery! I have an aggressive personality, and I just can''t tone it down. I try to be "mild," but my "bite" is too strong. I''m always the "garnish," never the "main." I just want to be loved for my zesty, uncompromising flavor, but I fear I''m just "too much" for most people.', 'Patient is small but has a very "loud" personality. He vibrated with "peppery" energy. He has "Garnish Imposter Syndrome" and is desperate to be taken "seriously." He expressed disdain for "mild-mannered" vegetables. We discussed that his "spice" is his strength, but he fears it''s what keeps him "sliced thin" and "sprinkled." He needs to accept his own intensity. He left a "zing" in the air.', true, '2025-11-17 11:10:00', '2025-11-17 11:10:00'),
(24, '2025-11-20 10:30:00', 1800, 'NO_SHOW', 'The Trellis', NULL, 'Gaston Greenbean', 'gaston@string.com', '5550000024', 'I''m a "string bean." It''s derogatory! I''m not just a string! I''m a complex legume! I''m also worried I''m "snappish." People are always "snapping" me. It''s traumatic. I''m worried I''m "too long" and "too green." I have this crippling fear of being "canned." The darkness... the brine... it''s too much.', 'Patient was a NO_SHOW. I received a text from his "pod-mate" Penelope Pea, saying Gaston was "too strung out" to attend. This tracks with his chart. He has deep-seated "snapping" trauma and a "canning" phobia. He is also known as "Frenchie," a name he despises. We need to reschedule, perhaps in a "bundle" with his support legumes.', false, '2025-11-17 11:15:00', '2025-11-17 11:15:00'),
(25, '2025-11-20 11:00:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Augustus Asparagus', 'gus@spear.com', '5550000025', 'I''m worried about my... odor. You know... *the* odor. After... *processing*. It''s embarrassing. It''s made me socially awkward. I''m worried about what people *think* after they''ve... *interacted* with me. I''m also very woody at one end and very tender at the other. It''s a duality I can''t reconcile.', 'Patient is tall, thin, and visibly anxious. He speaks in hushed tones about his "post-consumption olfactory effects." This "odor anxiety" has made him a recluse. He also has "woody-end" dysphoria, feeling he is "too tough" and "inedible" at his core. We discussed that the "odor" is not his fault, but a "biochemical reaction." He remains unconvinced. He is tightly bundled.', false, '2025-11-17 11:20:00', '2025-11-17 11:20:00'),
(26, '2025-11-20 11:30:00', 1800, 'REQUESTED', 'The Patch (Room 4)', NULL, 'Ethel Eggplant', 'ethel@nightshade.com', '5550000026', 'I am so... spongy. I just absorb everything. All the negativity, all the... oil. It''s exhausting being this porous. I have no boundaries! And my skin! It''s so shiny and purple, but people just want to "salt" me and "sweat" me. It''s dehumanizing! I''m not a "meat substitute," I am ETHEL!', 'Patient presents as "spongy" and "porous," absorbing the (negative) energy of the waiting room. She has a deep-seated "identity porosity" issue and "boundary" problems. She is bitter about being a "vegetarian option." We explored her "sponginess" as "empathy," but she sees it as a "curse." She is also very sensitive about her "gourd-like" shape, insisting she is a "berry." This is a complex case.', false, '2025-11-17 11:25:00', '2025-11-17 11:25:00'),
(27, '2025-11-20 12:00:00', 1800, 'COMPLETED', 'Room 1 (Cooler)', NULL, 'Brutus B. Sprout', 'brutus@brussels.com', '5550000027', 'I''m bitter, and I know why. I''m the "hated" vegetable. For generations, children have gagged at the mere sight of me. I''ve been "boiled to mush" and "over-roasted" until I''m a "fart-smelling" husk. I''m a "mini-cabbage" with a "giant" chip on my shoulder. I have so much resentment built up in my tiny, leafy body.', 'Patient is small, dense, and "compacted" with rage. He is the "spokes-sprout" for an entire generation of "maligned" vegetables. He believes his "bitterness" is "earned" and "justified." We discussed the "bacon and balsamic" revolution, which he sees as "pandering." He stated, "I''d rather be hated for what I am, than loved for what bacon makes me." This is a tough nut... or sprout... to crack.', true, '2025-11-17 11:30:00', '2025-11-17 11:30:00'),
(28, '2025-11-20 12:30:00', 1800, 'SCHEDULED', 'The Patch (Room 4)', NULL, 'Sven Spaghetti-Squash', 'sven@gourd.net', '5550000028', 'I''m an imposter. I''m not *really* spaghetti. I''m a lie. A "healthy alternative." I''m a gourd pretending to be a pasta. When they "rake" me with a fork, it feels like my entire identity is being "shredded." I want to be a real squash, like a butternut, with "substance" and "integrity." Not this... stringy facade.', 'Patient is suffering from "Pasta Imposter Syndrome" (PIS). He is pale yellow and visibly distraught. He described a recurring dream where he is "drowned in marinara" but "cannot absorb it" because he is "not porous." He feels "watery" and "insubstantial." We are working on "gourd-of-origin" acceptance. He needs to understand he is "squash," not "spaghetti," and that this is okay.', false, '2025-11-17 11:35:00', '2025-11-17 11:35:00'),
(29, '2025-11-20 13:00:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Kiyoko Kai-lan', 'kiyoko@gailan.cn', '5550000029', 'I am caught between two worlds. I am "Chinese Broccoli," but I am not broccoli. I am not Kale. I am my own unique, leafy, thick-stemmed self. But I am constantly being "stir-fried" into situations I am not comfortable with. People don''t appreciate my "subtle bitterness." They just douse me in oyster sauce.', 'Patient is experiencing a "cultural-culinary" identity crisis. She feels "lost in translation" between "Chinese" and "Broccoli." She is proud of her "thick stems," but insecure about her "small florets." She expressed frustration that her "bitter" notes are "misunderstood" by the "Western palate," which she finds "infantile" and "obsessed with sweetness." She has a superiority complex that masks deep-seated "fusion confusion."', false, '2025-11-17 11:40:00', '2025-11-17 11:40:00'),
(30, '2025-11-20 13:30:00', 1800, 'COMPLETED', 'Room 5', NULL, 'Captain Cabbage', 'cap@cruciferous.com', '5550000030', 'I''m just... a head. A disembodied head. I have no limbs, no... agency. I just... *am*. I''m worried I''m "boring." I''m the "peasant food." I''m not "exotic" like an artichoke. I''m just... cabbage. I''m dense. I smell... "funky" when I''m cooked. I''m just waiting to be "fermented" into something else.', 'Patient (a large, dense head of Savoy) presents with "Disembodied Head Syndrome" and "Low-Esteem Fermentation-Anxiety." He feels he is "all brain, no action." He described his "funky" odor as a "cry for help." We discussed his "layers" as "depth and complexity," but he sees them as "just more cabbage." He has a mortal fear of "slaw." Patient was "soured" by the experience and left early.', true, '2025-11-17 11:45:00', '2025-11-17 11:45:00'),
(31, '2025-11-21 09:00:00', 1800, 'SCHEDULED', 'Room 1 (Cooler)', NULL, 'Lettuce Lottie', 'lottie@leafy.com', '5550000031', 'I suffer from "Wilt Anxiety." The slightest heat, the smallest amount of pressure, and I collapse into a sad, soggy mess. I hate being called "crisp" because it puts too much pressure on me to maintain structural integrity. I need to learn to be okay with being soft and yielding, but I fear being discarded as "too old."', 'Patient is extremely delicate and easily distressed. She described a panic attack after being briefly exposed to room temperature air, resulting in "catastrophic wilting." We are working on "rehydration techniques" and "low-pressure environments." She is terrified of salad spinners, viewing them as instruments of torture. Recommended she avoid the top shelf of the refrigerator.', false, '2025-11-17 12:00:00', '2025-11-17 12:00:00'),
(32, '2025-11-21 09:30:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Sammy Sweet Potato', 'sammy@tuber.com', '5550000032', 'I am constantly confused for a yam. I am NOT a yam! It''s a different genus! The misidentification is a chronic source of stress. I feel I must constantly justify my existence and superior nutritional profile. I''m also addicted to brown sugar and marshmallows. I need help breaking this destructive, sweet cycle.', 'Patient has a deep-seated "Yam Identity Crisis" compounded by a severe sugar addiction. He believes his "sweetness" is his "tragic flaw." We are exploring the difference between *Ipomoea batatas* and *Dioscorea* to help him establish boundaries. He views Thanksgiving as a high-stress event. Advised patient to avoid all discussions involving "casseroles."', false, '2025-11-17 12:05:00', '2025-11-17 12:05:00'),
(33, '2025-11-21 10:00:00', 1800, 'COMPLETED', 'The Root Cellar', NULL, 'Clementine Cucumber', 'c.c@cool.net', '5550000033', 'I am perpetually cool, even under pressure. It''s exhausting being this unflappable. I want to feel normal human-vegetable emotions, but I just default to "cool as a cucumber." I suspect this is a defense mechanism from my traumatic pickling experience in my youth. I also have deep lines from being repeatedly "sliced."', 'Patient presents as overly calm and emotionally flat. She attributes her "coolness" to past trauma, specifically being "submerged in brine." She has significant anxiety related to her "smoothness" and fear of sharp objects. We discussed her internal feelings, but she only responded with "crisp" and "refreshing" metaphors. She needs to address her "Pickling PTSD."', true, '2025-11-17 12:10:00', '2025-11-17 12:10:00'),
(34, '2025-11-21 10:30:00', 1800, 'SCHEDULED', 'The Patch (Room 4)', NULL, 'Fiona Fennel', 'fiona@anise.com', '5550000034', 'I am polarizing. People either love my licorice flavor or they absolutely despise me. I don''t know how to navigate social settings when I know I might offend half the room just by existing. I try to be subtle, but my anise scent is just too strong. I hate being described as "bulbous," too. I am delicate and feathery!', 'Patient is anxious about her strong "anise-based" personality. She feels she is "too much" for most palates. She views her "fronds" as fragile but her "bulb" as a source of shame. We discussed that her unique flavor is a strength, not a weakness, but she fears being the "divisive element" in a dish. Recommended she try mingling with less assertive herbs.', false, '2025-11-17 12:15:00', '2025-11-17 12:15:00'),
(35, '2025-11-21 11:00:00', 1800, 'NO_SHOW', 'The Greenhouse (Room 3)', NULL, 'Roger Romaine', 'roger@cos.net', '5550000035', 'I have trust issues with Caesar. He seems fine, but I suspect he''s constantly planning my demise. I''m afraid of being "tossed" into a situation where I lose all control. I also don''t appreciate the expectation that I must always be the base for something greater. I am a leaf, not a foundation!', 'Patient was a NO_SHOW. Left a cryptic note: "Too much dressing today. Cannot risk being tossed." This confirms severe paranoia regarding his traditional role in a Caesar salad. The patient is suffering from "Tossing Trauma" and "Caesar-phobia." We need to work on the patient''s self-identity as an individual component rather than just a "vehicle" for dressing and croutons.', false, '2025-11-17 12:20:00', '2025-11-17 12:20:00'),
(36, '2025-11-21 11:30:00', 1800, 'SCHEDULED', 'Room 5', NULL, 'Patty Pepper (Jalapeño)', 'patty@heat.com', '5550000036', 'I am afraid I am losing my heat. My capsaicin levels feel low. What if I am just a mild, insignificant pepper? My whole identity is based on my ability to inflict pain! If I lose my fire, I lose my purpose. I need a capsaicin boost! Also, I have a deep fear of being "stuffed" and "baked." It''s too vulnerable.', 'Patient is experiencing "Heat-Loss Anxiety." She is extremely volatile and passionate about her Scoville rating. She sees her heat as her "masculinity" or "core strength." We discussed that her value is intrinsic, not based on relative pain induction. She is paranoid about being sliced and pickled, which she calls "being neutralized." Recommended a trip to the sunniest side of the garden.', false, '2025-11-17 12:25:00', '2025-11-17 12:25:00'),
(37, '2025-11-21 12:00:00', 1800, 'REQUESTED', 'Telehealth', 32, 'Sammy Sweet Potato', 'sammy@tuber.com', '5550000032', 'This is a follow-up to my yam confusion. It''s getting worse. I went to a party and someone called me a "Jewel Yam." It sent me into a spiral! I have been stress-eating brown sugar. I think I need to explore my childhood, specifically the trauma of being harvested next to a field of true yams. I need cognitive restructuring!', 'Follow-up visit. The "Yam Identity Crisis" is escalating, fueled by sugar consumption. Patient is actively seeking out confirmation of his "yam-ness" by arguing with Wikipedia editors. We utilized CBT (Carrot-Based Therapy) to reframe his self-perception. Must address the underlying fear of being "generic" if he is not a yam. Increased the frequency of therapy sessions.', false, '2025-11-17 12:30:00', '2025-11-17 12:30:00'),
(38, '2025-11-21 12:30:00', 1800, 'COMPLETED', 'The Patch (Room 4)', NULL, 'Harriet Horseradish', 'harriet@root.com', '5550000038', 'I am volatile and intensely emotional, but I only let it out when I''m grated. I keep everything bottled up, but the moment I feel attacked, I explode into an abrasive, sinus-clearing fury. I need techniques to express my rage without needing physical destruction. I also feel my whiteness is "too bland" and needs color.', 'Patient is suffering from "Grating Rage Syndrome." She is calm but tense, noting that her true feelings are only released via enzymatic destruction. We discussed healthy boundaries and verbal expression. She needs to understand that not every minor inconvenience requires a full "nasal-clearing explosion." Recommended working with red beets to introduce color and emotional balance.', true, '2025-11-17 12:35:00', '2025-11-17 12:35:00'),
(39, '2025-11-21 13:00:00', 1800, 'SCHEDULED', 'The Trellis', NULL, 'Penelope Pea', 'penelope@pod.net', '5550000002', 'I''m back. My pod-mates won''t stop singing. They''ve formed an a cappella group, and I cannot escape the noise. It''s a constant, high-pitched humming about the "unity of the legume." I need noise-canceling technology or a transfer to a solo pod. I''m seriously contemplating rolling away again, potentially into traffic (the garden path).', 'Recurrent patient with escalating "Pod Anxiety" and auditory distress. The singing group is a new stressor, heightening her need for individuality. Discussed the ethical implications of "rolling into traffic" (getting trampled by a gardener). Recommended a custom-fitted sound-dampening silk lining for her section of the pod. Referred to mediation for the a cappella issue.', false, '2025-11-17 12:40:00', '2025-11-17 12:40:00'),
(40, '2025-11-21 13:30:00', 1800, 'REQUESTED', 'The Root Cellar', NULL, 'Gary Ginger', 'gary@rhizome.org', '5550000040', 'I have a profound sense of "underground" guilt. I feel like I only surface when I''m needed to solve someone else''s digestive problem. I''m a remedy, not a personality. I want to be appreciated for my complex, zesty spirit, not just for my ability to cure nausea. I also have severe paranoia about being "candied."', 'Patient is suffering from "Cure Guilt" and feeling like a "utility root." He believes his purpose is purely transactional. He is highly sensitive to being "sliced and boiled." His fear of "candying" is linked to a fear of being "diluted" and made "palatable for children." We discussed self-care that doesn''t involve treating human ailments. Suggested journaling his "zesty thoughts."', false, '2025-11-17 12:45:00', '2025-11-17 12:45:00'),
(41, '2025-11-21 14:00:00', 1800, 'SCHEDULED', 'Room 1 (Cooler)', NULL, 'Bok Choy Bobby', 'bobby@asianleaf.net', '5550000041', 'I am vertically challenged. My leaves tower over my stems, and it makes me feel disproportionate. I''m a "two-part" vegetable, and I feel split between my "crunchy" identity and my "tender" identity. I am constantly worried about falling over and being stir-fried into oblivion. I need stability and validation for my stem structure.', 'Patient presents as slightly unstable, leaning heavily to one side. He suffers from "Vertical Structural Anxiety." His "split identity" between his water-heavy leaves and his solid stems is causing deep distress. We worked on integrating his crunchy and tender sides. He has a phobia of woks. Recommended he stand next to sturdier components, like Captain Cabbage, for moral support.', false, '2025-11-17 12:50:00', '2025-11-17 12:50:00'),
(42, '2025-11-21 14:30:00', 1800, 'COMPLETED', 'The Greenhouse (Room 3)', NULL, 'Hazel Heart of Palm', 'hazel@palm.org', '5550000042', 'I am devastated by my origin story. I am the "heart" of the palm tree, which means for me to exist, the whole tree must be cut down! I am a symbol of tragedy and deforestation! I have immense survivor''s guilt. I taste delicious, but it''s the taste of sacrifice. I don''t know how to enjoy my tender, creamy life.', 'Patient is suffering from acute "Destructive Harvest Guilt." She believes her existence is inherently selfish and tragic. We discussed the circle of life in the garden, but she remains fixated on the "deforestation" required for her extraction. She needs intensive therapy to accept that she is the result of natural cycles, not a malicious entity. Patient is surprisingly high-fiber for a soft center.', true, '2025-11-17 12:55:00', '2025-11-17 12:55:00'),
(43, '2025-11-21 15:00:00', 1800, 'SCHEDULED', 'The Trellis', NULL, 'Gigi Grape Leaf', 'gigi@vine.com', '5550000043', 'I am defined by my filling. Everyone just wants to roll me up and stuff me with rice and meat! I am never the main character! I am just a wrapper, a container, a glorified culinary envelope. What if I want to be a salad? What if I want to just photosynthesize? I feel like I''m constantly being stretched and prepped for stuffing.', 'Patient is suffering from "Wrapper Identity Syndrome." She feels her destiny is dictated entirely by her shape and flexibility. She described a recurring nightmare where she is "boiled in oil" before being "forcefully filled." We discussed that her role as a wrapper is honorable, but she sees it as a form of servitude. Recommended practicing "unrolled" time near the window.', false, '2025-11-17 13:00:00', '2025-11-17 13:00:00'),
(44, '2025-11-21 15:30:00', 1800, 'REQUESTED', 'Room 5', NULL, 'Fungi Freddy (Morel)', 'freddy@mycelium.com', '5550000044', 'I''m an elitist, and I need help. I look down on the common button mushrooms. I am expensive! I am rare! But I''m terrified I''m going to be confused for a deadly poisonous mushroom. The pressure of being the "exclusive" fungi is immense, and the thought of being misidentified and causing death is crushing my spirit.', 'Patient is an extremely expensive and arrogant Morel. He expressed disdain for all cultivated fungi, calling them "commoners." His core anxiety is related to his pitted, convoluted appearance which closely resembles deadly species. He has "Exclusive Fungi Fear" and "Toxicity Paranoia." We are working on humility and self-acceptance, even if he is "gourmet."', false, '2025-11-17 13:05:00', '2025-11-17 13:05:00'),
(45, '2025-11-21 16:00:00', 1800, 'SCHEDULED', 'The Root Cellar', NULL, 'Red R. Ruby', 'ruby@redroot.org', '5550000045', 'I''m a red onion, and I''m the "fun" one, the "salad" onion. But I still make people cry! It''s a double-standard! I have to look pretty and taste zesty, but I still have the internal mechanism for tears. I also hate being pickled; it makes my beautiful color leach out into a sad pink brine. I feel like my existence is a performance.', 'Patient is suffering from "Pretty Onion Performance Anxiety." She feels compelled to be both colorful and non-tear-inducing, a paradox that causes her great distress. She described her pickling experience as "a slow, color-draining betrayal." We are working on setting boundaries and accepting her natural, albeit pungent, side effects. She fears she is "too aesthetically pleasing" for her own good.', false, '2025-11-17 13:10:00', '2025-11-17 13:10:00'),
(46, '2025-11-21 16:30:00', 1800, 'CANCELED', 'The Patch (Room 4)', 26, 'Ethel Eggplant', 'ethel@nightshade.com', '5550000026', 'I had to cancel! I got too close to a vat of olive oil and I nearly absorbed it all. My boundaries are non-existent! I''m too spongy to manage this stress. I need a flotation device or a temporary coating to prevent accidental, traumatic absorption. I''m also worried I''m starting to turn brown on the inside.', 'Patient CANCELED, citing an "oil spill near the office." Her "Porosity Panic" is clearly still in effect, and she is unable to maintain boundaries in high-oil environments. She is exhibiting signs of internal oxidation (browning). Recommended immediate rest in a dark, dry environment. Will send a follow-up packet on "Boundary Setting for Porous Produce."', true, '2025-11-17 13:15:00', '2025-11-17 13:15:00'),
(47, '2025-11-21 17:00:00', 1800, 'SCHEDULED', 'Telehealth', NULL, 'Peter Plantain', 'pete@starch.com', '5550000047', 'I am perpetually confused with a banana. People always grab me, expect me to be sweet, and then are bitterly disappointed when I''m starch. I''m meant for savory dishes! I''m a complex carbohydrate with texture! I am not a casual snack! The constant comparison is devaluing my identity, and I''m afraid of being fried incorrectly.', 'Patient has severe "Banana Envy" and "Starch Stigma." He is frustrated by the assumption of sweetness based on his appearance. We are working on embracing his "savory" destiny and his potential in Tostones and Mofongo. His biggest fear is being "mashed and baked into a sweet bread." Must reinforce the difference between *Plantago* and *Musa* identity.', false, '2025-11-17 13:20:00', '2025-11-17 13:20:00'),
(48, '2025-11-21 17:30:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Gail Gherkin', 'gail@pickles.com', '5550000048', 'I am obsessed with my crunch. If I''m not crunchy, I''m nothing. I constantly test my structural integrity, but the stress is immense. I am afraid of going soft. I am a small cucumber, destined for greatness, but the thought of becoming a soggy, flabby pickle keeps me awake in brine-induced panic attacks.', 'Patient is suffering from "Crunch Obsession Disorder" (COD). Her self-worth is tied directly to her rigidity. She has a complex about her size, feeling she is "too small" but "destined for greatness" as a gherkin. We discussed that softness does not equal failure, but she remains convinced that "flabbiness is the enemy." Recommended she wear a mouthguard to prevent excessive self-testing.', false, '2025-11-17 13:25:00', '2025-11-17 13:25:00'),
(49, '2025-11-21 18:00:00', 1800, 'COMPLETED', 'Room 5', NULL, 'Fungi Freddy (Morel)', 'freddy@mycelium.com', '5550000044', 'I need a second opinion. I was briefly placed next to a Chanterelle, and my anxiety flared up. Why aren''t I as orange? Why am I so pitted and conical? I feel like my appearance is becoming less "gourmet" and more "swamp monster." I also had a nightmare that I was sautéed with butter and wine, and it was *too* delicious, which invalidates my elitism.', 'Follow-up visit. The patient''s "Elitism" is clashing with his "Toxicity Paranoia." He is now comparing himself to other expensive fungi. The nightmare of being "too delicious" suggests his subconscious is challenging his need to remain aloof. We are working on accepting that value can exist without being rare or condescending. He is still obsessed with his conical shape.', true, '2025-11-17 13:30:00', '2025-11-17 13:30:00'),
(50, '2025-11-21 18:30:00', 1800, 'SCHEDULED', 'The Root Cellar', NULL, 'Squashy Sheldon', 'sheldon@gourd.org', '5550000050', 'I am afraid of my own shape. I am a crookneck squash, and my curve makes me feel like I am permanently leaning into bad life decisions. Why can''t I be straight, like a zucchini? The curve implies I am "irregular" and "imperfect." I spend my entire day trying to stand straight, and the tension in my vine is unbearable.', 'Patient is suffering from "Crookneck Curvature Anxiety." He views his natural, anatomical curve as a moral failing or sign of instability. We discussed that the curve makes him unique and aesthetically interesting. He is paranoid that the bend in his neck will cause him to be rejected by the farmer''s market. Recommended wearing a small, straight splint for self-soothing purposes.', false, '2025-11-17 13:35:00', '2025-11-17 13:35:00'),
(51, '2025-11-22 09:00:00', 1800, 'SCHEDULED', 'Room 1 (Cooler)', NULL, 'Ingrid Iceberg', 'ingrid@crisp.net', '5550000051', 'I am suffering from immense self-doubt because I am 96% water and 0% nutrients. I feel utterly useless, yet I am inexplicably popular in fast-food settings. I am a shallow beauty! I want to be taken seriously, but I just keep thinking about how I will inevitably become a watery puddle on someone''s plate.', 'Patient is afflicted with "Nutritional Deficiency Guilt" and severe self-image issues due to her high water content. She has "Iceberg Imposter Syndrome," believing her popularity is unwarranted. We discussed that sometimes, being a simple, crunchy vessel for flavor is enough. Recommended pairing with more complex vegetables for moral support, such as Kale Kenny.', false, '2025-11-18 08:00:00', '2025-11-18 08:00:00'),
(52, '2025-11-22 09:30:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Paul Potato (Fingerling)', 'paul@finger.com', '5550000052', 'I am afraid of commitment. I am too small to be a Russet, and too big to be a baby potato. I am forever stuck in this "fingerling" stage, meaning I am frequently sliced lengthwise and pan-fried. I feel exposed and vulnerable. I need to figure out my place in the potato hierarchy before I become hash.', 'Patient is suffering from "Mid-Size Identity Confusion" and "Fingerling Fear." He is anxious about his elongated, slender shape, which he feels dictates his destiny (being sliced lengthwise). We are working on accepting his size and recognizing that his "firm texture" is a desirable trait. He is paranoid about being mistaken for a sweet potato, which would be an "utter failure."', false, '2025-11-18 08:05:00', '2025-11-18 08:05:00'),
(53, '2025-11-22 10:00:00', 1800, 'COMPLETED', 'The Root Cellar', NULL, 'Ezekiel Endive', 'ezekiel@chicory.com', '5550000053', 'I am profoundly bitter. My bitterness is my defining trait, and it has alienated me from my peers. I believe I am bitter because the world has wronged me, but I also enjoy the sharp, aggressive edge it gives me. I need to know: can I be bitter *and* happy? I also fear being filled with goat cheese, which I find cloying.', 'Patient is experiencing "Chronic Chicory Cynicism" (CCC). His bitterness is a source of pride, yet it prevents deep connection. We discussed channeling his bitterness into a "constructive sharpness," rather than a "destructive cynicism." He has a severe phobia of creamy dips and cheeses. Advised him to seek out acidic dressings to complement his personality.', true, '2025-11-18 08:10:00', '2025-11-18 08:10:00'),
(54, '2025-11-22 10:30:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Saffron Stem', 'saffron@spice.com', '5550000054', 'I am incredibly valuable and delicate, and the pressure is paralyzing. I am literally worth more than gold by weight! If I am handled incorrectly, I lose my flavor, my color, and my exorbitant market value. I fear being misused—thrown into a cheap rice dish where my complexity is lost. I need security detail!', 'Patient presents as extremely fragile and arrogant. He suffers from "Luxury Commodity Anxiety" and requires white-glove treatment. He refuses to be touched directly. We discussed separating his intrinsic value from his monetary worth, but he found the concept "quaint." He is convinced that the other root vegetables are trying to steal him. Recommended immediate de-escalation training.', false, '2025-11-18 08:15:00', '2025-11-18 08:15:00'),
(55, '2025-11-22 11:00:00', 1800, 'REQUESTED', 'Room 5', NULL, 'Wally Watercress', 'wally@aquatic.net', '5550000055', 'I feel overwhelmed by my environment. I live in water! I am constantly soggy! It''s cold and wet all the time, and I''m perpetually worried about drowning. I also have a mild peppery taste, but I worry it''s not strong enough to be noticed. I''m just floating through life without a solid purpose or foundation.', 'Patient is dealing with "Aquatic Existential Dread." His lack of solid roots and constant wetness has led to profound feelings of instability. He has "Spice Level Insecurity" and fears being mistaken for a limp weed. We worked on embracing his "floaty" nature and recognizing his resilience in riparian environments. Suggested he focus on his unique ability to grow rapidly.', false, '2025-11-18 08:20:00', '2025-11-18 08:20:00'),
(56, '2025-11-22 11:30:00', 1800, 'CANCELED', 'The Patch (Room 4)', NULL, 'Holly Hominy', 'holly@nixtamal.org', '5550000056', 'I don''t know who I am anymore. I was corn, then I was processed with lye (nixtamalization), and now I''m this bloated, chemically altered thing. I''ve lost my corn-identity! I''m a puffy imposter! I''m terrified of becoming a tortilla, which is just a flat version of my trauma. I feel like my past is constantly trying to flatten me.', 'Patient CANCELED. Sent a note saying she was "too puffed up with shame" to attend. She is suffering from severe "Nixtamalization Trauma" and an identity crisis stemming from chemical processing. She views her "puffy" appearance as a sign of irreversible damage. Her fear of becoming a tortilla is a fear of losing her 3D structure and individuality. Recommended self-soothing with warm air.', true, '2025-11-18 08:25:00', '2025-11-18 08:25:00'),
(57, '2025-11-22 12:00:00', 1800, 'SCHEDULED', 'The Trellis', NULL, 'Shelly Shell Bean', 'shelly@pole.net', '5550000057', 'I feel abandoned. I am always separated from my protective shell, my home. People just crack me open and discard my shell! It''s like my childhood is being ripped away over and over again. I want to feel secure outside of my pod. I have severe separation anxiety from my husk.', 'Patient is dealing with "Pod Separation Anxiety." She views her shell as her ultimate security blanket, and being "shelled" is a traumatic, recurring event. She worries that once she is shelled, she is "naked" and vulnerable to being frozen or canned. We are working on building an internal sense of security that is independent of her protective layers.', false, '2025-11-18 08:30:00', '2025-11-18 08:30:00'),
(58, '2025-11-22 12:30:00', 1800, 'COMPLETED', 'Room 1 (Cooler)', NULL, 'Phyllis Pickled Onion', 'phyllis@brine.com', '5550000058', 'I have an aggressive personality now. I used to be Olga Onion, but after the pickling, I am Phyllis! I''m vinegary, I''m pungent, and I don''t care who I offend. I believe my trauma gave me strength, but my friends say I''m just salty and acidic. I need to know: is this "new me" an improvement or a self-destructive defense mechanism?', 'Patient is a highly acidic personality with "Brine Identity Syndrome." She views her traumatic pickling as a "rebirth," but her increased aggression is alienating others. She claims the vinegar gives her "power." We discussed that while she is now "shelf-stable," she is also emotionally corrosive. Recommended a gradual reduction in her salt intake and exploring meditation to reduce acidity.', true, '2025-11-18 08:35:00', '2025-11-18 08:35:00'),
(59, '2025-11-22 13:00:00', 1800, 'SCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Baron Borage', 'baron@flower.com', '5550000059', 'I am confusing. I am a beautiful blue flower, but I taste like cucumber! I don''t know where I belong! Am I an herb? Am I a garnish? Am I a tea? My identity is a blur, and it leads to massive anxiety. I worry people only use me for my aesthetics and don''t appreciate my complex, confusing flavor profile.', 'Patient is suffering from "Identity Confusion via Flavor Profile." He is aesthetically pleasing but internally tormented by his cucumber-like taste. He feels his life is "garnish-based" and "superficial." We discussed that holding multiple identities (herb, flower, flavor) is unique. He is terrified of being candied or frozen into ice cubes, which he sees as "glamorizing his confusion."', false, '2025-11-18 08:40:00', '2025-11-18 08:40:00'),
(60, '2025-11-22 13:30:00', 1800, 'REQUESTED', 'Room 5', NULL, 'Quinn Quince', 'quinn@fruit.net', '5550000060', 'I am hard, fuzzy, and inedible when raw. I have to be boiled for hours, then sweetened to be palatable. I am high-maintenance and demanding, and I hate it! Why can''t I be an easy, ready-to-eat apple? I feel like I''m constantly forcing people to work for my affection, and my fuzzy coat is just a big defense mechanism.', 'Patient is suffering from "High-Maintenance Hardness Anxiety." He knows his demanding preparation process is off-putting, but he can''t change his raw, acidic nature. His fuzzy skin is a visible sign of his emotional defense mechanisms. We discussed that the "hard work" yields a unique, complex flavor, but he views it as "unnecessary labor." He is obsessed with his softer, less challenging counterparts.', false, '2025-11-18 08:45:00', '2025-11-18 08:45:00'),
(61, '2025-11-22 14:00:00', 1800, 'SCHEDULED', 'The Patch (Room 4)', NULL, 'Patty Pepper (Jalapeño)', 'patty@heat.com', '5550000036', 'My Scoville levels are definitely dropping. I went to a party, and someone ate me *without* flinching. I felt completely emasculated! This is a crisis! I need a heat-boosting regimen, maybe a combination of intense sunlight and aggressive cross-breeding. I fear I will be downgraded to a bell pepper!', 'Follow-up visit. The "Heat-Loss Anxiety" has intensified, resulting in an obsession with her Scoville rating. She views the lack of flinching as a personal attack on her identity. We discussed that her internal capsaicin is volatile and can fluctuate, but she needs a steady identity independent of heat. Prescribed a mild placebo oil treatment and referred to Dr. Freddy Fungi for perspective.', false, '2025-11-18 08:50:00', '2025-11-18 08:50:00'),
(62, '2025-11-22 14:30:00', 1800, 'COMPLETED', 'Telehealth', 47, 'Peter Plantain', 'pete@starch.com', '5550000047', 'I''m having difficulty with my "starchiness." My family keeps trying to ripen me to make me sweet. They want me to be a banana! I have to constantly hide in the pantry to avoid being turned into a dessert. I need strategies to firmly assert my savory identity in the face of familial pressure.', 'Follow-up visit. Patient''s "Starch Stigma" is being exacerbated by family intervention. He feels his savory identity is under siege. We role-played assertive statements like, "I am a cooking banana, and I am meant for high heat, not morning cereal." Reinforced the difference between *Plantago* and *Musa* again. Recommended a temporary relocation to a deep fryer.', true, '2025-11-18 08:55:00', '2025-11-18 08:55:00'),
(63, '2025-11-22 15:00:00', 1800, 'REQUESTED', 'The Root Cellar', NULL, 'Rita Rutabaga', 'rita@brassica.org', '5550000063', 'I am perpetually confused for a swede, and I hate it! They''re the same thing! But that doesn''t help! I also hate my waxy, thick skin. It feels like a prison. I know I''m sweet on the inside, but nobody takes the time to peel and cook me. I''m too much effort, so I just sit here and wax my outer layer.', 'Patient is experiencing "Swede/Rutabaga Identity Collapse." She is frustrated by the dual naming convention which prevents her from establishing a singular self. Her thick, waxy skin is an extreme defense mechanism against emotional intimacy and peeling. We discussed her internal "sweetness" and how to let it shine without being so aggressively shielded. She fears the peeler as an invasive surgical tool.', false, '2025-11-18 09:00:00', '2025-11-18 09:00:00'),
(64, '2025-11-22 15:30:00', 1800, 'SCHEDULED', 'Room 1 (Cooler)', NULL, 'Chandra Chard', 'chandra@swiss.com', '5550000064', 'I am confused by my name. I am **Swiss** Chard, but I am not from Switzerland! It''s a marketing lie that generates anxiety. Where are my roots? What am I standing for? Also, I have a brightly colored stem and a dull green leaf. I feel like my body is split into two conflicting personalities: one flashy, one muted.', 'Patient is suffering from "Geographical Misnomer Stress." The Swiss branding has caused deep anxiety about her true heritage. Her conflicting stem (red/yellow) and leaf (green) colors represent a split personality disorder. We are working on integrating her "flashy" stem side with her "earthy" leaf side. She hates being called "just like spinach, but tougher."', false, '2025-11-18 09:05:00', '2025-11-18 09:05:00'),
(65, '2025-11-22 16:00:00', 1800, 'REQUESTED', 'The Greenhouse (Room 3)', NULL, 'Danny Dill', 'danny@herb.net', '5550000065', 'I feel weak. I''m just a flimsy, feathery herb. I look delicate, and I am delicate! I am constantly getting bruised and dried out. I want to be a strong, woody herb, like rosemary, with structural integrity. I''m tired of being associated only with pickles and salmon. My life is fleeting and fragile.', 'Patient is experiencing "Structural Integrity Envy" of the woody herbs. He sees his "flimsy" nature as a physical manifestation of his emotional weakness. He believes his destiny is to be either pickled or smoked. We discussed that his delicacy allows him to infuse flavor gently, but he sees this as passive aggression. Prescribed a mild potassium spray for strength.', false, '2025-11-18 09:10:00', '2025-11-18 09:10:00'),
(66, '2025-11-22 16:30:00', 1800, 'COMPLETED', 'Room 5', NULL, 'Cormac Celery Root', 'cormac@root.com', '5550000066', 'I am hideous. Look at me! I''m lumpy, covered in dirt, hairy, and just generally an unsightly mess. I have massive body image issues. I know I taste great, like a subtle celery, but nobody can get past my monstrous exterior. I wish I was smooth and elegant, like a parsnip. I feel like I need intense plastic surgery.', 'Patient is suffering from extreme "Root Vegetable Dysmorphia." He is obsessed with his lumpy, hairy, dirt-encrusted exterior. He views his rough appearance as a personal and moral failing, despite his excellent internal flavor profile. We discussed self-acceptance and the beauty of being "rustic." He needs to stop comparing himself to the smooth, pale root vegetables. Recommended embracing his natural texture.', true, '2025-11-18 09:15:00', '2025-11-18 09:15:00'),
(67, '2025-11-22 17:00:00', 1800, 'SCHEDULED', 'Telehealth', NULL, 'Timmy Taro', 'timmy@rhizome.com', '5550000067', 'I am afraid of my own sliminess. When I''m cut, I ooze this sticky, gooey substance, and I hate it! It makes me feel unclean and messy. I''m terrified of being mashed because I think I will just turn into a massive, sticky blob. I want to be dry and flaky, like a normal potato. I need to stop oozing!', 'Patient is suffering from "Mucilage Phobia" (sliminess fear). He views his naturally gooey, sticky texture as a sign of profound contamination. He believes his destiny is to become a messy, unmanageable food item, like poi. We are working on understanding that the sliminess is protective and helps him in wet soil conditions. Recommended wearing gloves during the session to reduce anxiety.', false, '2025-11-18 09:20:00', '2025-11-18 09:20:00'),
(68, '2025-11-22 17:30:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Veronica Vicia Faba (Broad Bean)', 'vici@faba.com', '5550000068', 'I am stuck between a green identity and a white identity. When I''m young, I''m bright green and tender, but when I get old, I turn pale and require peeling. I hate the pressure of aging! I don''t want to lose my vibrancy and be forced to discard my outer skin. I want to stay eternally young and green!', 'Patient is experiencing "Age-Related Identity Anxiety" and "Shelling Stress." She is fearful of losing her youthful green color and the laborious process required for her consumption as an aged, pale bean. We discussed that the "pale stage" brings a nuttier, richer flavor, but she sees it as a decline. She is obsessed with anti-aging techniques, such as immediate freezing after harvest.', false, '2025-11-18 09:25:00', '2025-11-18 09:25:00'),
(69, '2025-11-22 18:00:00', 1800, 'SCHEDULED', 'The Root Cellar', NULL, 'Alvin Allspice', 'alvin@spice.com', '5550000069', 'I am a one-man spice cabinet, and the responsibility is too much. I taste like cinnamon, cloves, and nutmeg all at once! This causes massive identity overload. I don''t know which flavor to lead with. I worry I''m just a "flavor mashup" without a singular identity. I need to simplify my flavor profile!', 'Patient is suffering from "Flavor Identity Overload." He feels his complexity is a burden, believing he should pick just one spice to embody. He is stressed by the pressure of being the "only spice needed" for many holiday dishes. We are working on accepting that his "all-in-one" nature is his strength, not a sign of confusion. Recommended separating himself into three small bowls for symbolic clarity.', false, '2025-11-18 09:30:00', '2025-11-18 09:30:00'),
(70, '2025-11-22 18:30:00', 1800, 'REQUESTED', 'Room 1 (Cooler)', 51, 'Ingrid Iceberg', 'ingrid@crisp.net', '5550000051', 'I am deeply distressed. I was used as the base for a greasy taco salad, and I started weeping! My water content couldn''t handle the heat or the oil, and I completely lost my crunch. I need an emergency session to re-establish my boundaries and structural integrity. I feel violated by the ground beef.', 'Recurrent patient with "Wilt Anxiety" exacerbated by a high-fat, high-stress culinary environment (taco salad). Her structural collapse has triggered intense feelings of failure. We focused on recognizing the external factors (grease, heat) that caused the wilting, not her internal failing. Prescribed a 24-hour immersion in ice water for self-care and structural repair.', false, '2025-11-18 09:35:00', '2025-11-18 09:35:00'),
(71, '2025-11-23 09:00:00', 1800, 'SCHEDULED', 'The Patch (Room 4)', NULL, 'Squashy Sheldon', 'sheldon@gourd.org', '5550000050', 'I’ve tried to straighten myself, but the curve is too ingrained. My chiropractor vine told me it’s anatomical. How can I accept this crookneck curvature? I also have a new fear: being turned into a clown face for a children''s play. My curve makes me look like I''m permanently smiling, and I''m not!', 'Follow-up visit. The "Crookneck Curvature Anxiety" is now being compounded by a fear of "Clown-Face Stigmatization." He feels his natural curve makes him a caricature. We are using cognitive restructuring to reframe the curve as "elegant geometry" rather than a flaw. He refuses to wear the self-soothing splint, claiming it "violates his bodily autonomy."', false, '2025-11-18 09:40:00', '2025-11-18 09:40:00'),
(72, '2025-11-23 09:30:00', 1800, 'REQUESTED', 'The Trellis', NULL, 'Gigi Grape Leaf', 'gigi@vine.com', '5550000043', 'I am desperate to be seen as more than a dolma wrap. I tried to stage a protest by tearing a hole in myself, but it just made me look like "damaged goods." I want to be a beautiful, unburdened leaf, but my destiny is servitude. I need a new destiny! I have a newfound phobia of the phrase "finger food."', 'Patient is escalating her "Wrapper Identity Syndrome." The self-harming protest was a cry for help against her role as a food wrapper. She sees her fate as an existential tragedy. We discussed alternative uses, such as herbal tea or a decorative element, but she dismissed them as "too passive." She needs to accept that her flexibility is valued.', false, '2025-11-18 09:45:00', '2025-11-18 09:45:00'),
(73, '2025-11-23 10:00:00', 1800, 'COMPLETED', 'The Root Cellar', NULL, 'Prudence Pimiento', 'prudence@capsicum.com', '5550000073', 'I am a shell of my former self. I am perpetually hollowed out, deveined, and stuffed into olives! I''ve lost all sense of self. I am defined by the pit I replace. I fear I am just a "vegetable prosthetic." I want to be a full, complete pepper, not a surgically altered, brine-soaked cavity filler.', 'Patient is suffering from "Vegetable Prosthetic Despair." She is deeply traumatized by the "hollowing out" process and the subsequent immersion in brine. She views her role in olives as a cruel joke. We discussed her importance as a flavor component, but she wants to be a whole entity. Recommended she find a support group for other "stuffed" or "hollowed" produce.', true, '2025-11-18 09:50:00', '2025-11-18 09:50:00'),
(74, '2025-11-23 10:30:00', 1800, 'SCHEDULED', 'Room 5', NULL, 'Simon Scallion', 'simon@spring.com', '5550000074', 'I am experiencing profound ambiguity. I am not an onion, not a chive, not a leek. I am a *scallion*. I am forever stuck in this "green onion" purgatory. I am almost always sliced thinly, which is a constant reminder of my lack of bulk or depth. I need to find dignity in being a garnish!', 'Patient is suffering from "Ambiguous Allium Anxiety." He feels his lack of a solid bulb prevents him from being taken seriously. He sees his thin slicing as a metaphor for his insignificant role in the culinary world. We are working on reframing his "garnish" role as a "final flourish" of importance. He is envious of Lucinda Leek''s sophistication.', false, '2025-11-18 09:55:00', '2025-11-18 09:55:00'),
(75, '2025-11-23 11:00:00', 1800, 'REQUESTED', 'The Greenhouse (Room 3)', NULL, 'Mister Mustard Green', 'mustard@leafy.com', '5550000075', 'I am furious. I am too spicy! When I''m cooked, I release a pungent, eye-watering odor that offends everyone. I need help controlling my internal volatile compounds. I want to be milder and more socially acceptable, like spinach. My life is a series of strong, angry flavors and pungent smells.', 'Patient is suffering from "Aggressive Volatility Syndrome" (AVS). His inherent pungency, especially when cooked, is causing social isolation and self-loathing. He sees his intense flavor as a failure to be neutral. We are working on methods to "tame" the volatile compounds (like adding acid), but he resists, saying it''s "selling out." Needs to accept his spicy heritage.', false, '2025-11-18 10:00:00', '2025-11-18 10:00:00'),
(76, '2025-11-23 11:30:00', 1800, 'CANCELED', 'The Root Cellar', NULL, 'Cornelius ''Corny'' Corn', 'c.c@husk.org', '5550000008', 'I was too distressed by the GMO documentary to leave the crib. My existential modification dread has peaked, and I cannot face the public until I have definitive proof that I am not a genetically engineered super-maize destined for a popcorn singularity. The shame is immense, and the husk is too tight for travel.', 'Patient CANCELED the appointment with no prior notice. He is still highly paranoid about his genetic origins and potential modification. The corn kernel security blanket seems insufficient. Clinician fears the patient is spiraling into a deep "agri-science" induced neurosis. Must attempt contact again, perhaps offering non-GMO, organic therapy options.', true, '2025-11-18 10:05:00', '2025-11-18 10:05:00'),
(77, '2025-11-23 12:00:00', 1800, 'NO_SHOW', 'Telehealth', NULL, 'Felix Fiddlehead', 'felix@fern.com', '5550000077', 'I was stressed about my brief season of popularity, and the pressure to be exotic and highly sought-after in that short window was too much. I failed to uncurl from my fetal shape, which I view as a complete psychological collapse. I could not face the clinician while still physically resembling a tightly wound coil of self-doubt and pre-spring anxiety.', 'Patient NO_SHOW. I suspect his "Transient Popularity Anxiety" caused a physical paralysis, preventing him from uncoiling and leaving the forest floor. The patient views his coiled shape as a sign of being emotionally stunted. Sent a gentle reminder that he is valuable, even if his season is brief, and suggested a focus on vertical growth next time.', false, '2025-11-18 10:10:00', '2025-11-18 10:10:00'),
(78, '2025-11-23 12:30:00', 1800, 'RESCHEDULED', 'The Greenhouse (Room 3)', NULL, 'Rita Radicchio', 'rita@chicory.com', '5550000078', 'I am visually stunning, but my bitterness is an internal battle. I need more time to manage the profound internal cynicism that defines me, as I fear I will offend the clinician with my sharp, aggressive nature. I need to be less beautiful and less bitter before I can have a productive session.', 'Patient RESCHEDULED to a later date, citing a need to "temper her internal acidity." She is struggling with her "Aesthetic Deception Guilt." We need to work on embracing her bitterness as "depth" rather than a flaw. Recommended a session of light roasting and a drizzle of honey before the next appointment to manage volatility.', false, '2025-11-18 10:15:00', '2025-11-18 10:15:00'),
(79, '2025-11-23 13:00:00', 1800, 'CANCELED', 'Room 1 (Cooler)', NULL, 'Sammy Seaweed (Nori)', 'sammy@ocean.net', '5550000079', 'I am flat, dry, and always being rolled up around something else. I had an accident—I briefly touched a damp cloth and my structural integrity was compromised. I am now a soggy, amorphous mess. I cannot be transported in this state, as I fear complete dissolution. The slightest moisture is my mortal enemy.', 'Patient CANCELED due to a transportation accident involving environmental moisture. His "Aquatic Identity Misclassification" is secondary to his "Moisture Phobia." His refusal to be soggy is absolute, despite his marine origin. Recommended immediate heat lamp exposure and a protective seal for future visits. The session was literally too wet to happen.', true, '2025-11-18 10:20:00', '2025-11-18 10:20:00'),
(80, '2025-11-23 13:30:00', 1800, 'NO_SHOW', 'Room 5', NULL, 'Arturo Arugula', 'arturo@spicy.com', '5550000080', 'I am high-strung and easily agitated. I was worried about "bolting" during the 30-minute commute, so I decided to stay home and focus on shallow, controlled growth. The risk of becoming too bitter and large to enter the office was too great, and I couldn''t risk the structural integrity of my spicy leaves.', 'Patient NO_SHOW. I believe his "Size-Related Flavor Anxiety" prevented him from leaving the garden. He is obsessed with maintaining a small, palatable size and views growth as a betrayal of his flavor profile. Sent a note stating that bitterness is a natural phase of life, not a moral failing. Must address his "bolting" fears in the next session.', false, '2025-11-18 10:25:00', '2025-11-18 10:25:00'),
(81, '2025-11-23 14:00:00', 1800, 'RESCHEDULED', 'The Patch (Room 4)', NULL, 'Mister Millet', 'mister@grain.com', '5550000081', 'I need to postpone my visit. I just saw Quinoa on the cover of a major food magazine, and my "Pseudocereal Obscurity Syndrome" flared up severely. I need time to emotionally process the inequality of the grain hierarchy before I can focus on my own well-being. My depression regarding being relegated to "birdseed" is too acute today.', 'Patient RESCHEDULED citing a competitive trauma response triggered by a high-profile competitor. His envy of Quinoa is a major impediment to his therapy. We discussed focusing on his own unique strengths, but he is fixated on achieving celebrity status. Must prepare for a deep dive into the marketing failures of pseudocereals next time.', false, '2025-11-18 10:30:00', '2025-11-18 10:30:00'),
(82, '2025-11-23 14:30:00', 1800, 'CANCELED', 'The Trellis', NULL, 'Giselle Green Pea', 'giselle@pod.net', '5550000082', 'I was accidentally subjected to a blast chiller! My body is frozen solid, and I cannot be moved. I am experiencing the very "Preservation Phobia" I came here to discuss. This is a traumatic event! I fear I will remain in this unnatural, preserved state forever, my "fresh identity" lost to the freezer burn of time.', 'Patient CANCELED following an acute traumatic incident (accidental freezing). This confirms her deep-seated fear of preservation. Her "fresh identity" is temporarily suspended. Recommended slow thawing and gentle reintroduction to the real world. This is a profound case of fear manifesting into reality, requiring specialized post-thaw counseling.', true, '2025-11-18 10:35:00', '2025-11-18 10:35:00'),
(83, '2025-11-23 15:00:00', 1800, 'NO_SHOW', 'The Root Cellar', NULL, 'Yvonne Yucca Root', 'yvonne@starch.org', '5550000083', 'I became too hard to transport safely. I tried to be peeled and sliced for travel, but the effort required was too immense, and I stalled the entire transport system. I decided it was safer for everyone if I just stayed home and remained in my rough, protective, inedible state.', 'Patient NO_SHOW. Her "High-Effort Existentialism" has materialized as a physical barrier to treatment. She needs extensive processing to be safely handled. Sent a reminder that her intrinsic value is not tied to the amount of labor she requires. Must schedule a longer appointment next time, perhaps requiring industrial-grade peeling equipment.', false, '2025-11-18 10:40:00', '2025-11-18 10:40:00'),
(84, '2025-11-23 15:30:00', 1800, 'RESCHEDULED', 'Room 1 (Cooler)', NULL, 'Reggie Rhubarb', 'reggie@stalk.com', '5550000084', 'I need to push this appointment back to January. December is the height of the holiday baking season, and my "Pie Destiny Avoidance" is too strong right now. I cannot mentally cope with the thought of being boiled down and sugared into a dessert. I need to assert my savory identity in a less stressful month.', 'Patient RESCHEDULED to a post-holiday date to avoid triggering his "Pie Destiny Anxiety." He is deeply resistant to his traditional culinary fate. We are working on viewing his stalk form as a symbol of savory resilience. Recommended avoiding eye contact with any pastry chefs or sugar bowls until the New Year.', false, '2025-11-18 10:45:00', '2025-11-18 10:45:00'),
(85, '2025-11-23 16:00:00', 1800, 'CANCELED', 'The Greenhouse (Room 3)', NULL, 'Fanny Fava Bean', 'fanny@faba.com', '5550000085', 'I saw a bottle of Chianti on the waiting room table during a scouting trip, and I panicked! The association with Hannibal Lecter and cannibalism is too strong! My "Culinary Pop Culture Trauma" has reasserted itself, and I cannot attend. I fear I will be paired with an intellectual predator.', 'Patient CANCELED at the last minute. The mere sight of an associated prop (Chianti) triggered her "Fava Bean Sinister Stigmatization." She believes she is a cursed ingredient. Clinician must ensure the waiting room is free of all references to psychological thrillers and Italian red wine before the next session.', true, '2025-11-18 10:50:00', '2025-11-18 10:50:00'),
(86, '2025-11-23 16:30:00', 1800, 'NO_SHOW', 'Room 5', NULL, 'Gideon Grain (Quinoa)', 'gideon@trendy.net', '5550000086', 'I am currently too important to attend therapy. I am being flown first-class to a major food conference as a "complete protein" keynote speaker. My schedule cannot accommodate an appointment with mere vegetable clinicians. My fame is currently at its zenith, and I refuse to interrupt the glory for introspection.', 'Patient NO_SHOW. Reason given was extreme arrogance and an over-inflated sense of self-importance due to his "Celebrity Pseudocereal" status. His lack of humility is now affecting his adherence to his own schedule. Must address this severe case of narcissism when he finally descends from his high horse.', false, '2025-11-18 10:55:00', '2025-11-18 10:55:00'),
(87, '2025-11-23 17:00:00', 1800, 'RESCHEDULED', 'The Trellis', NULL, 'Herman Herb (Basil)', 'herman@pesto.com', '5550000087', 'I need to postpone. The temperature is rising outside, and my "Oxidation Anxiety" is peaking. I fear I will turn black and lose all value before I reach the office. I must wait for a cooler, safer day, or else my session will devolve into a discussion about my premature moral decay.', 'Patient RESCHEDULED due to high environmental heat, triggering his fear of "browning" and "moral decay." He is highly sensitive to his freshness. We must schedule his appointments for early morning or late evening when oxidation risk is lowest. Sent self-care tips focusing on anti-oxidant rich pairings like lemon juice.', false, '2025-11-18 11:00:00', '2025-11-18 11:00:00'),
(88, '2025-11-23 17:30:00', 1800, 'CANCELED', 'The Root Cellar', NULL, 'Olive Oil Olive', 'olive@olea.com', '5550000088', 'I am suffering from a profound crisis. I was in transit, but my container developed a micro-fissure, and I began to slowly leak out. I cannot continue my journey while I am literally losing my fluid identity. I must return to storage and mourn the loss of my precious, cold-pressed essence.', 'Patient CANCELED. The "Liquefaction Trauma" has been physically realized by a container breach, causing the patient to lose volume and form. The loss of essence is a devastating blow to her already fragile, fluid identity. Recommended immediate resealing and emotional stabilization before attempting travel again.', true, '2025-11-18 11:05:00', '2025-11-18 11:05:00'),
(89, '2025-11-23 18:00:00', 1800, 'NO_SHOW', 'Room 1 (Cooler)', NULL, 'Mandy Manioc', 'mandy@cassava.com', '5550000089', 'I was too afraid to leave my safe preparation area. I feared that if I was improperly jostled or bumped, I might release residual toxins and harm the other waiting patients. My burden of toxicity is too immense to risk the trip. I need a solo, sealed session when the facility is empty.', 'Patient NO_SHOW. Her "Toxicity Guilt" is preventing her from engaging with the outside world. She views herself as a potential biological hazard. We must find a way to convince her that her *prepared* state is safe, otherwise, she will remain isolated. A sterile, sealed environment for the next session is advisable.', false, '2025-11-18 11:10:00', '2025-11-18 11:10:00'),
(90, '2025-11-23 18:30:00', 1800, 'RESCHEDULED', 'Telehealth', NULL, 'Pippa Purslane', 'pippa@succulent.net', '5550000090', 'I need to postpone immediately! The Head Gardener is doing his rounds, and I was nearly mistaken for a common weed and ripped out of the ground! My "Weed Shame" and fear of the trowel are at an all-time high. I need to hide until the danger passes and the gardener is occupied elsewhere.', 'Patient RESCHEDULED due to a genuine threat of uprooting by the Head Gardener. Her "Weed Shaming" is justified by the current external threat. Recommended she find a safe, inconspicuous place to wait until the next session. This case requires addressing both internal shame and external discrimination.', false, '2025-11-18 11:15:00', '2025-11-18 11:15:00'),
(91, '2025-11-24 09:00:00', 1800, 'CANCELED', 'The Greenhouse (Room 3)', NULL, 'Salty Sam (Caper)', 'salty@brine.com', '5550000091', 'I was rinsed! A careless intern thought I was too salty and put me under the tap! I am watered down, stripped of my briny character, and now I feel utterly meaningless. I am no longer a caper; I am a bland, flavorless bud. I cannot attend therapy while suffering from this profound identity loss.', 'Patient CANCELED due to traumatic rinsing. His "Punctuation Syndrome" is now compounded by a "Brine Identity Loss." He is a shadow of his former, salty self. Recommended immediate re-brining therapy to restore his core character and dignity. The intern has been advised that capers should never be rinsed.', true, '2025-11-18 11:20:00', '2025-11-18 11:20:00'),
(92, '2025-11-24 09:30:00', 1800, 'NO_SHOW', 'The Patch (Room 4)', NULL, 'Tofu Tina', 'tina@soy.net', '5550000092', 'I was pressed into a new, extremely dense block this morning. I am now too heavy and rigid to move, and my texture is all wrong. I feel like my essence has been violently extracted. I cannot come to the office until I have re-established my structural integrity and mourned the loss of my initial fluffiness.', 'Patient NO_SHOW. She was subject to excessive pressing, leaving her too dense and structurally rigid to mobilize. Her "Imposter Protein Syndrome" is intensified by the feeling that her form is constantly being manipulated. Must schedule the next appointment when she is in a softer, more manageable state.', false, '2025-11-18 11:25:00', '2025-11-18 11:25:00'),
(93, '2025-11-24 10:00:00', 1800, 'RESCHEDULED', 'The Trellis', NULL, 'Shelly Shell Bean', 'shelly@pole.net', '5550000057', 'I had a breakthrough, but the emotional cost was immense. My "Refried Repetition Anxiety" is still too active. I need a week to process the concept of existing without being mashed. I fear that if I come in now, I will be psychologically vulnerable to the next phase of consumption. I need to stay whole for a bit longer.', 'Patient RESCHEDULED to give herself time to process the emotional breakthrough and manage her lingering "Refried Repetition Anxiety." She is making progress on accepting her "whole bean" identity but requires continued support to overcome her fear of mashing. Advised her to avoid all culinary processes involving high pressure.', false, '2025-11-18 11:30:00', '2025-11-18 11:30:00'),
(94, '2025-11-24 10:30:00', 1800, 'CANCELED', 'The Root Cellar', NULL, 'Celine Collard Green', 'celine@southern.com', '5550000094', 'I am still too tough! I started boiling myself at 5 AM, and I am still resisting softening. I cannot attend therapy until I am sufficiently yielded to the forces of heat and water. My fibrous resistance is a chronic scheduling issue. I will not come until I can present a non-chewy version of myself.', 'Patient CANCELED. Her "Chronic Fibrous Resistance" is a literal barrier to her attendance. She refuses to seek help until she has met an impossible standard of tenderness. We must address the pride she takes in her toughness versus the practical scheduling difficulties it creates. Referred to an industrial pressure cooker specialist for faster softening.', true, '2025-11-18 11:35:00', '2025-11-18 11:35:00'),
(95, '2025-11-24 11:00:00', 1800, 'NO_SHOW', 'Room 5', NULL, 'Arturo Arugula', 'arturo@spicy.com', '5550000080', 'I have fully bolted. I am now a towering seed stalk! I couldn''t fit through the door of the office! My existence as a consumer-grade leaf is over, and I am now dedicated to seed production. I am too big and too bitter for the waiting room. My failure is magnificent, and I refuse to be cut down.', 'Patient NO_SHOW. He has transitioned into his reproductive phase, making him physically incompatible with the office space. His "Bolting Catastrophe" is now complete, and he views his bitterness as wisdom. Must schedule a large outdoor session or communicate via long-distance drone camera for the next check-in.', false, '2025-11-18 11:40:00', '2025-11-18 11:40:00'),
(96, '2025-11-24 11:30:00', 1800, 'RESCHEDULED', 'Room 1 (Cooler)', NULL, 'Mister Mustard Green', 'mustard@leafy.com', '5550000075', 'I need more time to develop my layers! My "Layer Envy" (Artichoke-envy) is too strong, and I cannot face the public until I have figured out a way to physically fold myself into a more complex, protected head. I need time for intensive internal restructuring!', 'Patient RESCHEDULED. He is obsessed with achieving the physical complexity of an artichoke to manage his volatile emotional state. He refuses to attend until he has developed sufficient physical boundaries. Recommended a referral to a top vegetable origami specialist, as structural change is biologically impossible.', false, '2025-11-18 11:45:00', '2025-11-18 11:45:00'),
(97, '2025-11-24 12:00:00', 1800, 'CANCELED', 'Telehealth', NULL, 'Bertram Bamboo Shoot', 'bertram@shoot.com', '5550000097', 'I grew too tall! Since booking, I have grown over three feet and burst through the roof of my container! I cannot be safely transported or contained. My "Rapid Growth Anxiety" has become a literal, architectural problem. I will have to cancel until I can control my vertical trajectory.', 'Patient CANCELED due to uncontrollable rapid growth, resulting in structural failure of his container. His "Woodiness Phobia" is still active, but his immediate problem is being too tall for society. Recommended seeking counseling from a very large tree or skyscraper to manage his immense scale.', true, '2025-11-18 11:50:00', '2025-11-18 11:50:00'),
(98, '2025-11-24 12:30:00', 1800, 'NO_SHOW', 'The Trellis', NULL, 'Opal Okra', 'opal@goo.org', '5550000098', 'I am too slimy to touch the door handle! My mucilage levels are spiking, and I cannot risk leaving a trail of textural failure through the office. I am trapped by my own internal structure. I will have to remain here until my "Mucilage Shame" subsides or someone invents anti-goo technology.', 'Patient NO_SHOW. Her "Mucilage Shame" has escalated into physical paralysis. She fears contact due to her texture. Sent instructions for dry-roasting self-therapy at home, as this cooking method reduces sliminess and may give her the courage to attend a future session.', false, '2025-11-18 11:55:00', '2025-11-18 11:55:00'),
(99, '2025-11-24 13:00:00', 1800, 'RESCHEDULED', 'The Root Cellar', NULL, 'Wanda Wasabi', 'wanda@spice.org', '5550000099', 'I need to postpone the session. I just found another counterfeit paste being sold as me! I must dedicate all my resources to proving my authenticity and suing the fake horseradish industry. I cannot focus on my own emotional needs while my core identity is being actively stolen.', 'Patient RESCHEDULED due to an escalating legal battle against "Identity Theft" by the horseradish industry. Her paranoia is valid, but the focus on external validation is hindering therapy. Advised her to focus on *her* unique zing, regardless of market competition. Needs to bring forensic evidence to the next session.', false, '2025-11-18 12:00:00', '2025-11-18 12:00:00'),
(100, '2025-11-24 13:30:00', 1800, 'CANCELED', 'The Greenhouse (Room 3)', NULL, 'The entire Vegetable Kingdom', 'kingdom@earth.org', '5550000100', 'We have reached a collective agreement that the consumption of our brethren by sentient beings is too high a psychological burden to bear. The weight of being delicious and existentially complex has caused mass emotional retreat. We demand a collective moment of silence, not a therapy session, until our fate is clarified.', 'Group session CANCELED. The collective burnout and existential dread of the Vegetable Kingdom has reached critical mass, leading to a system-wide emotional shutdown. The representatives refused to leave their assigned patches. Recommended a temporary moratorium on harvesting activities to stabilize the mental health of the plant population.', true, '2025-11-18 12:05:00', '2025-11-18 12:05:00');

